import React, {useState, useEF} from 'react'
import axios from 'axios'

const AllReviews = () => {
    const [reviews, setReviews] = useState([])

    axios.get('http://localhost:5000/api/all-reviews')
    .then(review => {
        setReviews(review)
        console.log('it got here')
    })
    .catch(err => {
        console.log(err)
    })

    return(
        <div>
            <h1>Reviews</h1>
            {
                reviews.map(review =>{
                    return <h1>{review.title}</h1>
                })
            }
        </div>
    )
}

export default AllReviews
